El Presidente (English: The President; Filipino: Ang Pangulo) is a 2012 biopic film based on the life of Gen. Emilio Aguinaldo, the first president of the Philippine Republic. The film stars Laguna Gov. Jeorge Estregan in the title role, with Cesar Montano, Christopher de Leon, Nora Aunor, and Cristine Reyes in supporting roles.[1]
It is produced by Scenema Concept International. It is one of the official entries for the 2012 Metro Manila Film Festival and was released in theaters nationwide on December 25, 2012

